export function Person (props) {
    return <div>
        <div>
            Nome: {props.name}
        </div>
        <div>
            Idade: {props.age}
        </div>
        <div>
            Sexo: {props.gender}
        </div>
    </div>
}

const people =[
    { name: 'Carlos', age: 34, gender: 'Male'},
    { name: 'Bruno', age: 30, gender: 'Male'},
]

export function People (props) {
    return <div>
        <div>{props.listName}</div>
        <Person name={props.people[0].name} age={props.people[0].age} gender={props.people[0].gender} />
        <Person name={props.people[1].name} age={props.people[1].age} gender={props.people[1].gender} />
    </div>
}

export default function App () {
    return <div>
        <People listName={'Lista'} people={people} />
    </div>
}
